import React from "react";
import './App.css'


const Popup = props => {
    return(
        <div className="popup-box" style={{display: 'flex',  justifyContent:'center', alignItems:'center', height: '100vh'}}>
            <div className="box">
                <span className="close-icon" onClick={props.handleClose}>x</span>
                {props.content}
            </div>

        </div>
    )
}

export default Popup;
